import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import add from './images/add.png';
import {
  Button, Container, Nav, Navbar, NavDropdown, Alert,
  Accordion, Card, Badge, Breadcrumb, ButtonGroup, ListGroup,
  Carousel, CloseButton, DropdownButton, Dropdown, Figure, Tab, Row, Col,
  Sonnet,
} from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';
import CustomToggle from './CustomToggle/CustomToggle';
import ButtonLoading from './ButtonLoading/ButtonLoading';
import ModalReact from './Modal/Modal';

function App() {

  const [ok, setOk] = useState(0);
  return (
    <div className="App">
      <Navbar bg="light" expand='false'>
        <Container>
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>
              <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">
                  Another action
                </NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">
                  Separated link
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default App;
